const extra = $('EXTRA').item.json;

let webhook = extra.n8nhost + "/webhook/from-chatwoot?";
webhook += "identifier=" + extra.identifier + "&";
webhook += "utoken=" + extra.utoken + "&";
webhook += "atoken=" + extra.atoken + "&";

if (extra.qphost !== "http://127.0.0.1:31000"){
  webhook += "qphost=" + extra.qphost + "&";
}

if (extra.cwhost !== "http://127.0.0.1:3000"){
  webhook += "cwhost=" + extra.cwhost + "&";
}

//if (extra.cwpublic){
//  webhook += "cwpublic=" + extra.cwpublic + "&";
//}

webhook = webhook.replace(/\&+$/, '');

$input.item.json.webhook = webhook;
return $input.item;

const content = $json.content?.trim() ?? ''; // Remover espaços extras no início e fim

// Identificar comando, telefone e variáveis
let command = "";
let phoneNumber = "";
let variables = {};

// Expressão regular unificada
const regex = /^(\/(paircode|qrcode))\s*(\+?[0-9]+)?\s*(.*)$/;
const matches = content.match(regex);

if (matches) {
    command = matches[2]; // Captura "paircode" ou "qrcode"
    phoneNumber = matches[3] || ""; // Captura o número de telefone, se existir
    const variablesString = matches[4] || ""; // Captura as variáveis, se existirem

    // Processar variáveis no formato "--nome=valor"
    variablesString.match(/--([a-zA-Z0-9\-]+)=([0-9]+)/g)?.forEach(variable => {
        const [key, value] = variable.replace('--', '').split('=');
        variables[key] = value;
    });
}

// Definir timeout padrão e verificar se foi substituído por uma variável
let timeout = parseInt(variables.timeout) || 30;

return {
  "conversation": $json.conversation,
  "timeout": timeout, // Usa o valor da variável timeout, se disponível
  "message": $json.content,
  "command": command,
  "phoneNumber": phoneNumber,
  "variables": variables
};
